import {Link, animateScroll as scroll} from 'react-scroll';
import './MenuContent.scss';

export function MenuContent () {
    scrollToTop = () => {
        scroll.scrollToTop();
      };

    return (

        <div className="fadein">

            <ul className="box">
                <li>
                    <a href="#">
                        Home
                    </a>
                </li>
                <li className="nav-item">
                <Link
                activeClass="active"
                to="rooms"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              />
                        Habitaciones
                </li>
                <li> 
                    <a href="#">
                    Descubre Ortegal
                    </a>
                </li>
                <li>
                    <a href="#">
                        Contacto
                    </a>
                </li>
            </ul>

        </div>

    )
}
export default MenuContent;
